import React from "react";
import Header from './Layout/AppHeader';
import Footer from './Layout/AppFooter';
import SearchFilter from "./SearchFilter";
// import jj from '../assets/image/in';

const Home = () => {
    return (
        <>
            <Header />
            <SearchFilter />
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 rounded-full">
            <img className="w-24 h-24 mb-3 rounded-full shadow-lg" src={require('../assets/image/index1.jpg')} alt="Bonnie"/>
            <img className="w-24 h-24 mb-3 rounded-full shadow-lg" src="../assets/image/index1.jpg" alt="Bonnie"/>
            <img className="w-24 h-24 mb-3 rounded-full shadow-lg" src="../assets/image/index1.jpg" alt="Bonnie"/>
            <img className="w-24 h-24 mb-3 rounded-full shadow-lg" src="../assets/image/index1.jpg" alt="Bonnie"/>
            </div>
            <Footer />
        </>
    )
}

export default Home;
